synchronized DB getPreviousDB(DB db) {
  Iterator<DB> iterator = rollingdbs.values().iterator();
  DB prev = null;
  while (iterator.hasNext()) {
    DB cur = iterator.next();
    if (cur == db) {
      break;
    }
    prev = cur;
  }
  return prev;
}
